import React from "react";
import "./grid.css";
import { SortBy } from "./molecules/sortBy";
import { cardNumber } from "./helpers";
import { displayAllRow } from "./helpers";

export default function Grid(props) {
  const rows = cardNumber(props.categorizedItems,[])

  function showMappedRow(rows)
  {
    rows.map((row) => (displayAllRow,
      row))
  }
  return (
    <div className="menu">
      <SortBy children="Buy Fresh Vegetables Online" sort={["Relevance","Popularity","Price"]}/>
      <div className="card">
        {
        showMappedRow(rows)
        }
      </div>
    </div>
  );
}
